  [],\n\t\"revision_timestamp\": \"2016-02-26T22:15:54.637462\",\n\t\"name\": \"archive-of-geosample-data-and-information-from-the-university-of-minnesota-national-lacust\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"LacCore has operated the National Lacustrine
  Core Repository since 2000, and now curates the world's largest and most diverse
  collection of lacustrine sediment cores. The biggest contributors (by core volume)
  are drilling projects, but small-volume projects outnumber the drilling campaigns
  by a factor of nearly 50. The vast majority of the curated materials are moist,
  cylindrical cores split in half, but unsplit cores, grab samples, dry cores, and
  a rapidly-growing number of rock cores, peat cores, freeze cores and permafrost
  cores round out the collection. The Repository also curates unused subsamples and
  sample residues for re-distribution and analysis. In addition to these physical
  holdings, LacCore captures metadata for all materials moving through the Facility;
  thus cores processed at LacCore but stored at other institutions are integrated
  among the physical holdings for the purpose of data discovery.  LacCore is a partner
  in the Index to Marine and Lacustrine Geological Samples (IMLGS) database. As a
  partner repository, LacCore sends data and information related to the LacCore sample
  collection to NCEI for long-term archive, and for discoverability via the IMLGS.\",\n\t\"license_title\":
